Добро пожаловать! У нас собраны самые интересные блюда мира. Возможности приложения:

+ Более 6000 рецептов;
+ Все рецепты абсолютно бесплатные;
+ Приложение работает без подключения к интернету;
+ База рецептов регулярно пополняется новыми рецептами;
+ Все рецепты с фотографиями;
+ Много рецептов с пошаговыми фотографиями;
+ Более 100 категорий рецептов;
+ Поиск по названию, ингредиентам и категории;
+ Избранное;
+ Список покупок;
+ Сортировка и фильтр;
+ Личные заметки к рецептам;
+ Возможность комментировать, оценивать рецепты, а также добавлять свои фотографии в комментарии;
+ Рейтинг лучших рецептов за день, неделю, месяц;
+ Интересные статьи и полезные советы;
+ Возможность отключить рекламу.

Мы готовы выслушать любые ваши идеи и пожелания относительно дальнейшего развития приложения. 

Все кулинарные рецепты собираются из открытых источников.

Приятного аппетита!

В приложении может отображаться реклама от Audience Network Facebook (https://m.facebook.com/ads/ad_choices)

«Burger King Беларусь» — удобное приложение для заказа еды.

Проголодались?
Установите официальное мобильное приложение “Burger King Беларусь"!

Заказывайте бургеры и оплачивайте в несколько касаний. Больше не нужно стоять в очереди: можете заказать в приложении, пройти в зону выдачи и показать код заказа из SMS!

Бесплатная служба доставки бургеров по всей Беларуси. Установите приложение и получайте приятные бонусы и купоны на доставку — проводим акции каждую неделю! 

Возможности приложения “Burger King Беларусь”:

∙ Оформление заказа в ресторане и на драйве;
∙ Оформление заказа на доставку еды;
∙ Оформление отложенного заказа доставки к заданному времени;
∙ Оплата банковскими картами прямо из приложения;
∙ Доступ к истории всех заказов;
∙ Купоны, акции и скидки при заказе в ресторанах и на доставку;
∙ Возможность быстро находить ближайшие рестораны.

